import './App.css';
import logo from './CLC_logo1.png'
import menu from './Menu.png'
// import logo from '../'

function App() {
  return (
    <div className="App">
      <div id='header' style={{backgroundColor: 'black'}}> <img src={logo}/> <img src={menu}/> </div>
    </div>
  );
}

export default App;
